<template>
	<view :data-theme="theme">
		<view class="CommissionRank">
			<view class="header">
				<view class="rank" v-if="position">ÊÇ®ÁõÆÂâçÁöÑÊéíÂêç<text class="num">{{position}}</text>Âêç</view>
				<view class="rank" v-else>ÊÇ®ÁõÆÂâçÊöÇÊó†ÊéíÂêç</view>
			</view>
			<view class="wrapper">
				<view class="nav acea-row row-around">
					<view class="item" :class="active == index ? 'font_color' : ''" v-for="(item,index) in navList" :key="index"
					 @click="switchTap(index)">
						{{ item }}
					</view>
				</view>
				<view class="list">
					<view class="item acea-row row-between-wrapper" v-for="(item,index) in rankList" :key="index">
						<view class="num" v-if="index <= 2">
							<image :src="'/static/images/medal0'+(index+1)+'.png'"></image>
						</view>
						<view class="num" v-else>
							{{index+1}}
						</view>
						<view class="picTxt acea-row row-between-wrapper">
							<view class="pictrue">
								<image :src="item.avatar"></image>
							</view>
							<view class="text line1">{{item.nickname}}</view>
						</view>
						<view class="people font_color">Ôø•{{item.brokeragePrice}}</view>
					</view>
				</view>
				<view class='noCommodity' v-if="rankList.length == 0 && isShow">
					<emptyPage title="ÊöÇÊó†ÊéíË°åÔΩû"></emptyPage>
				</view>
			</view>
		</view>
		<!-- <home></home> -->
	</view>
</template>

<script>
	import {
		getBrokerageRank,
		brokerageRankNumber
	} from '@/api/user.js';
	import {toLogin} from '@/libs/login.js';
	import home from '@/components/home';
	import emptyPage from '@/components/emptyPage.vue'
	import {mapGetters} from "vuex";
	import {setThemeColor} from '@/utils/setTheme.js'
	const app = getApp();
	export default {
		components: {
			emptyPage,
			home,
		},
		data() {
			return {
				navList: ["Âë®ÊéíË°å", "ÊúàÊéíË°å"],
				active: 0,
				rankList: [],
				page: 1,
				limit: 20,
				loadend: false,
				loading: false,
				loadTitle: 'Âä†ËΩΩÊõ¥Â§ö',
				type: 'week',
				position: 0,
				isShow: false,
				isAuto: false, //Ê≤°ÊúâÊéàÊùÉÁöÑ‰∏ç‰ºöËá™Âä®ÊéàÊùÉ
				isShowAuth: false, //ÊòØÂê¶ÈöêËóèÊéàÊùÉ
				theme:app.globalData.theme,
				bgColor:'#e93323'
			};
		},
		computed: mapGetters(['isLogin']),
		watch:{
			isLogin:{
				handler:function(newV,oldV){
					if(newV){
						this.getBrokerageRankList();
						this.getBrokerageRankNumber(this.type);
					}
				},
				deep:true
			}
		},
		onLoad() {
			if (this.isLogin) {
				this.getBrokerageRankList();
				this.getBrokerageRankNumber(this.type);
			} else {
				toLogin();
			}
			let that = this;
			that.bgColor = setThemeColor();
			uni.setNavigationBarColor({
				frontColor: '#ffffff',
				backgroundColor:that.bgColor,
			});
		},
		methods: {
			onLoadFun: function() {
				this.getBrokerageRankList();
				this.getBrokerageRankNumber(this.type);
			},
			// ÊéàÊùÉÂÖ≥Èó≠
			authColse: function(e) {
				this.isShowAuth = e
			},
			switchTap: function(index) {
				this.active = index;
				this.type = index ? 'month' : 'week';
				this.page = 1;
				this.loadend = false;
				this.$set(this, 'rankList', []);
				this.getBrokerageRankList();
				this.getBrokerageRankNumber(this.type);
			},
			getBrokerageRankNumber(type) {
				brokerageRankNumber({
					type: type
				}).then(res => {
					this.position = res.data;
				})
			},
			getBrokerageRankList: function() {
				if (this.loadend) return;
				if (this.loading) return;
				this.loading = true;
				this.loadTitle = '';
				getBrokerageRank({
					page: this.page,
					limit: this.limit,
					type: this.type
				}).then(res => {
					let list = res.data || [];
					let loadend = list.length <= this.limit;
					this.rankList.push.apply(this.rankList, list);
					this.loading = false;
					this.loadend = loadend;
					this.loadTitle = loadend ? 'üòïÂ∑≤ÊòæÁ§∫ÂÖ®ÈÉ®‰ø°ÊÅØ' : 'Âä†ËΩΩÊõ¥Â§ö';
					this.$set(this, 'rankList', this.rankList);
					this.isShow = true;
					//this.position = res.data.position;
				}).catch(err => {
					this.loading = false;
					this.loadTitle = 'Âä†ËΩΩÊõ¥Â§ö'; 
				})
			}
		},
		onReachBottom: function() {
			this.getBrokerageRankList();
		}
	}
</script>

